import React, { useState } from "react";
import "../../styles/Profile.css";

const Profile = () => {
    const [surname, setSurname] = useState("");
    const [name, setName] = useState("");
    const [patronymic, setPatronymic] = useState("");

    return (
        <div className="profile">
            <div className="person_data">
                <input onChange={e => setSurname(e.target.value)} value={surname} placeholder="Surname"/>
                <input onChange={e => setName(e.target.value)} value={name} placeholder="Name"/>
                <input onChange={e => setPatronymic(e.target.value)} value={patronymic} placeholder="Patronymic"/>
                <button className="confirm">Submit</button>
            </div>
            <div className="profile_data">

            </div>
        </div>
    )
}

export default Profile;
